import React from "react";
import BackgroundComponent from "./components/BackgroundComponent";
import bgImage from "./img/login_background.jpg";
import ButtonComponent from "./components/ButtonComponent";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useHistory,
  useLocation,
  useParams
} from "react-router-dom";
function App() {
  return (
    <Router>
      <div>
        <BackgroundComponent imageUrl={bgImage} />
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
            <li>
              <Link to="/button">Button</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users/:id">
            <Users />
          </Route>
          <Route path="/button">
            <ButtonComponent />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About(props) {
  return <h2>About</h2>;
}

function Users(props) {
  console.log(props);
  return <h2>Users</h2>;
}
export default App;
